import React from 'react';
import { Link } from 'react-router-dom';
function Card({ image, name, id, status, location }) {
  return (
    <div className="card">
      <Link to={`/details/${id}`}>
        <img src={image} alt="" />
        <p>
          <span>NAME: </span>
          {name}
        </p>
        <p>
          <span>STATUS: </span>
          {status}
        </p>
        <p>
          <span>NAME: </span>
          {<span>NAME: </span>}
        </p>
      </Link>
    </div>
  );
}

export default Card;
